import React,{UseState} from "react";
import Carousel from "react-bootstrap/Carousel";





function carousel(){

    const[index,setIndex]=UseState(1)

    const handleSelect=(selectedIndex,e) =>{
        setIndex(selectedIndex);

    };
    return(
        <div>
            <Carousel fade="true" activeIndex={index} onSelect={handleSelect}>
                <Carousel.Item>
                    <img className="d-block w-100" src=" https://c.ndtvimg.com/2018-10/ohqcobr_handi-biryani_625x300_08_October_18.jpg"
                    alt=" First Image" style={{height:"100vh"}}
                    />
                    <Carousel.Caption>
                      <h3>Delicious quality chicken Biriyani</h3>  
                      <p>hii hello</p>
                    </Carousel.Caption>
               </Carousel.Item>

               <Carousel.Item>
                    <img className="d-block w-100" src=" https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZVgOegzU_QCOI_o27WN6x3YIzryP2roUvFg&usqp=CAU"
                    alt=" Second Image" style={{height:"100vh"}}
                    />
                    <Carousel.Caption>
                      <h3>Protien Rich Biriyani</h3>  
                      <p>hii hello</p>
                    </Carousel.Caption>
               </Carousel.Item>
            </Carousel>

        </div>
    )
}

export default carousel
